import React from "react";

const ItemDetail =({detalles})=>{
    const imagen= detalles.images || []
    

    return(
        <>
        <h1>Aqui esto es {detalles.id} y </h1>
        <img src={imagen[0]} alt="" />
        <h3>{detalles.description}</h3>


        
        </>
    )

}

export default ItemDetail
